IN CONVERSATION: The dust has settled back home after a month long trip, so I’m ready to tell you about this Big Exciting Thing. Please read through for your own opportunity to participate in an exciting exhibit. Swipe for a list of participating artists (😳honestly, not going to lie, I’m feeling the pressure here). Then go over one slide further for a clue to the conversation @lorena_in_syd and I have on the regular (and recently had in person!!!).

